    [],nt"num_tags": 3,nt"name": "san-francisco-bay-national-wildlife-refuge-annual-narrative-report-1987",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for San Francisco
    Bay NWR, San Pablo Bay NWR, Antioch Dunes NWR, Farallon NWR, and Ellicott Slough
    NWR outlines Refuge accomplishments during the 1987 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    manpower programs, volunteer programs, funding, safety, and technical assistance
    is given. Habitat management is also covered; subjects include wetlands, forests,
    grasslands, grazing, haying, fire management, pest control, and wilderness areas.
    The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, marine mammals, fisheries
    resources, wildlife propagation, animal control, and marking and bird banding. The
    public uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, communication
    systems, and energy conservation.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
